pragma solidity 0.6.4;
pragma experimental ABIEncoderV2;

import "./ExtendedAssets.sol";


contract Accounts is ExtendedAssets {

    using SafeMath for uint256;

    // when opening account
    event OpenAccount(address indexed owner, bytes8 indexed publisher);

    /**
    *
    * Transfer Lock:
    *           * 0 : open => Assets from every publisher are allowed
    *           * 1 : open-whitelist => Every whitelisted asset-publisher is allowed (owner can modify)
    *           * 2 : whitelist => As above, but only publisher can modify it
    *           * 3 : closed => Only assets from publisher are allowed
    */
    struct Account {
        bool active;
        bytes8 publisher;
        bytes32[] assets;
        uint256 created;
        uint8 transferLock;                     // 0 = open ; 1 = open-whitelist ; 2 = whitelist ; 3 = closed
        mapping(bytes8 => bool) whitelist;
        mapping(bytes8 => bool) blacklist;
        mapping(bytes32 => uint256) balance;
    }

    mapping(address => Account) internal _accounts;

    // ----------------------------------------------------------------------------------------------------------
    // ------------------------------------------------ CONSTRUCTOR ---------------------------------------------
    // ----------------------------------------------------------------------------------------------------------


    constructor(address publishersAddress, address assetsAddress)
        ExtendedAssets(publishersAddress, assetsAddress) public {
    }

    // ----------------------------------------------------------------------------------------------------------
    // ------------------------------------------------ MODIFIERS -----------------------------------------------
    // ----------------------------------------------------------------------------------------------------------

    modifier _isOwnerOrPublisher(address account, address sender){
        require(
            _publishers.isOwner(_accounts[account].publisher, sender) || account == sender,
            "Can only be modified by wallet owner or publisher"
        );
        _;
    }

    // ----------------------------------------------------------------------------------------------------------
    // ------------------------------------------------ SETTERS -------------------------------------------------
    // ----------------------------------------------------------------------------------------------------------

    /**
     * Open new account
     */
    function open(bytes8 publisher, address account, uint8 transferLock) public payable returns (bool) {

        // check if valid publisher
        require(
            _publishers.isAvailable(publisher),
            "Unknown publisher or not active"
        );

        // check if called by publisher
        require(
            _publishers.isOwner(publisher, msg.sender),
            "Can only be modified by publisher"
        );

        // check if not already exists
        require(
            _accounts[account].created == 0,
            "Account exists"
        );

        // check if valid transferLock was given
        require(transferLock < 4, "Invalid lock-mode specified");

        Account memory _account;
        _account.created = block.timestamp;
        _account.active = true;
        _account.transferLock = transferLock;
        _account.publisher = publisher;
        _accounts[account] = _account;

        emit OpenAccount(account, publisher);

        return true;
    }

    /**
     *  Change transfer lock => only allowed by publisher
     */
    function setAccountTransferLock(address account, uint8 transferLock) public payable {

        require(
            _publishers.getOwner(_accounts[account].publisher) == msg.sender,
            "Only publisher can modify Transfer Lock"
        );

        require(transferLock < 4, "Invalid Transfer Lock specified");

        _accounts[account].transferLock = transferLock;
    }

    /**
      *  Modify whitelist
      *  owner: Address of wallet
      *  targetPublisher: Assets from publishers to grant transfer
      *  remove: Add or remove target from whitelist
      */
    function whitelist(address account, bytes8 targetPublisher, bool listed)
        public payable _isOwnerOrPublisher(account, msg.sender){

        require(
            _accounts[account].transferLock != 0 && _accounts[account].transferLock != 3,
            "Wallet not in whitelist lock mode"
        );

        if (_accounts[account].transferLock == 2) {
            require(
                _publishers.isOwner(_accounts[account].publisher, msg.sender),
                "Closed whitelist, only publisher can modify"
            );
        }

        _accounts[account].whitelist[targetPublisher] = listed;
    }

    /**
      *  Modify blacklist
      *  owner: Address of wallet
      *  targetPublisher: Assets from publishers to deny transfer
      *  remove: Add or remove target from blacklist
      */
    function blacklist(address account, bytes8 targetPublisher, bool listed)
        public payable _isOwnerOrPublisher(account, msg.sender){

        // TODO: Only if transferLock == 0
        _accounts[account].blacklist[targetPublisher] = listed;
    }

    function setActive(address account,bool active) public _isOwnerOrPublisher(account, msg.sender){
        _accounts[account].active = active;
    }

    // ----------------------------------------------------------------------------------------------------------
    // ------------------------------------------------ GETTERS -------------------------------------------------
    // ----------------------------------------------------------------------------------------------------------

    struct Balance {
        bytes32 asset;
        uint256 balance;
    }


    function getBalance(address account, uint offset) public view returns(Balance[10] memory, uint256) {
        Balance[10] memory stores;
        uint count = _accounts[account].assets.length;
        uint index = 0;

        for (uint a = 0;a < count; a++) {
            //Skip data if there is offset
            if (offset > a) continue;

            Balance memory _store;
            _store.asset = _accounts[account].assets[a];
            _store.balance = _accounts[account].balance[_store.asset];
            stores[index++] = _store;

            // exit loop after 10 rounds
            if (index == 10) break;
        }

        return (stores, count);
    }

    struct AccountInfo {
        bool active;
        bytes8 publisher;
        uint256 created;
        uint256 assets;
        uint8 transferLock;
    }

    /*
     *   Return wallet info
     */
    function getAccount(address account) public view returns (AccountInfo memory){
        Account memory wallet = _accounts[account];
        AccountInfo memory info;
        info.active = wallet.active;
        info.publisher = wallet.publisher;
        info.created = wallet.created;
        info.assets = _accounts[account].assets.length;
        info.transferLock = wallet.transferLock;
        //info.whitelist = wallet.whitelist;
        //info.blacklist = wallet.whitelist;
        return info;
    }

}
